import React from "react";
import Forms from "./Components/Forms/InputFields";
import Logo from "./Components/Logo/Logo";
const Index = () => {
  return (
    <div style={{display:"flex",minHeight:"100vh"}}>
      <div style={{width:"40%" ,alignSelf:"center",justifyContent:""}}>
        <Logo />
      </div>
      <div style={{width:"60%"}}>
        <Forms />
      </div>
    </div>
  );
};

export default Index;
